import React from 'react';
import './App.css';

function App() {
	return (
		<div className='App'>
			<div>
				<img
					id={`logo-image`}
					src='https://i.postimg.cc/3xyTvxpm/spacex-logo-261-268-hd-wallpapers.jpg'
				/>
			</div>
		</div>
	);
}

export default App;
